import React, { useState } from "react";
import Column from "./Column";
import { DndProvider } from "react-dnd";
import { HTML5Backend } from "react-dnd-html5-backend";

import "../Kanban.css";

export default function KanbanTable() {
  // default data for the columns
  const todo = ["Mee töihin", "tee sitä"];
  const inProgress = ["tee tätä"];
  const done = [];

  return (
    <DndProvider>
      <div className="container">
        <h1 className="header">Kanban Table</h1>
        <div className="kanban">
          <Column header="ToDo" defaultData={todo} />
          <Column header="In Progress" defaultData={inProgress} />
          <Column header="Done" defaultData={done} />
        </div>
      </div>
    </DndProvider>
  );
}
